import React from 'react'
import { useUsers } from '../hooks/use-users'
import { FlatList, StyleSheet, View } from 'react-native'
import { Item } from './item'

export const Users = () => {
  const users = useUsers()
  console.log('Users: ', users)

  return <View style={styles.container}>
    {users && <FlatList data={users} renderItem={(user: any) => <Item username={user.username} id={user.id} />} keyExtractor={(user, index) => `${index}`} />}
  </View>
}

const styles = StyleSheet.create<any>({
  container: {
    width: '100%',
    maxHeight: '80%',
    marginTop: 0,
    marginBottom: 0,
    marginLeft: 'auto',
    marginRight: 'auto',
    gap: 5,
    flexDirection: 'row',
    flexWrap: 'wrap',
    overflowY: 'auto',
  }
})
